26-06-2013 10:38 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('8193', '<ACTE num="8193"> <num>8233</num>) <date>22-9-1755</date> :     <epoux id="7"><prenom>Juan Esteban</prenom>de <nom de="true">OLEA</nom>,     <condition>indio</condition>, <naissance-lieu>natural de     Tucumán</naissance-lieu>, hijo legítimo de <pere legitime="true" id="9">     <prenom>Agustín</prenom> de <nom de="true">Olea</nom> </pere> y de <mere id="10">         <prenom>Cristina</prenom>       </mere>, indios</epoux>, con <epouse id="8"><prenom>María Pascuala</prenom>     <nom>ORTIZ</nom>, española, <naissance-lieu>natural de     ésta</naissance-lieu>, hija legítima de <pere id="11">         <prenom>Pedro</prenom>          <nom>Ortiz</nom>       </pere>, difunto, y de <mere id="12">         <prenom>Juana Gregoria</prenom>          <nom>Ramírez</nom>       </mere></epouse>. <temoins>Ts.: <temoin id="13">         <prenom>Francisco</prenom>          <nom>Guzmán</nom>       </temoin>, y <temoin id="14">         <prenom>Sabina</prenom>          <nom>Alvarado</nom>       </temoin></temoins>. Nota: C 8/214, "Juan Esteban Olea, mestizo al     parecer, y María Pascuala Ortiz, que se duda si es española, pero ella     dice que sí, y pobre", (f. 130).</ACTE>')
