26-06-2013 10:38 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('10241', '<ACTE num="10241">10267)<date>25-8-1812</date>:     <epoux id="37"><prenom>Dámaso</prenom> <nom>SAAVEDRA</nom>, natural de la     <naissance-lieu>ciudad de Córdoba</naissance-lieu>, hijo legítimo de <pere id="39">         <prenom>Luis</prenom>          <nom>Saavedra</nom>       </pere> y de <mere id="40">         <prenom>Josefa</prenom>          <nom>Pedraza</nom>       </mere>,</epoux>, con <epouse id="38"><prenom>María Micaela</prenom>     <nom>MURIÑIGO</nom>, natural <naissance-lieu>de ésta</naissance-lieu>,     hija legítima de <pere id="41">         <prenom>Juan</prenom>          <nom>Muriñigo</nom>       </pere>, y de <mere id="42">         <prenom>María Josefa</prenom>          <nom>Romero</nom>       </mere></epouse>. Ts.: <temoins><temoin id="43">         <prenom>Anselmo</prenom>          <nom>Grela</nom>       </temoin>, y <temoin id="44">         <prenom>Atanasia</prenom>          <nom>Ibarrola</nom>       </temoin></temoins>. (f. 45).</ACTE>')
