26-06-2013 10:38 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('5721', '<ACTE num="5721">5757) <date>2-4-1782</date>: Dn. <epoux don="true" id="366"><prenom>Diego</prenom> de <nom de="true">ALVEAR</nom> y <nom y="true">ESCALERA</nom> <nom>PONCE</nom> de <nom de="true">LEON</nom>,     <condition>Teniente de Navio de la Real Armada</condition>, natural de la     ciudad de <naissance-lieu>Montilla, Obispado de Córdoba</naissance-lieu>,     hijo legítimo de <pere don="true" id="368">Dn. <prenom>Santiago</prenom>     <prenom>María</prenom> de <nom de="true">Alvear</nom> y <nom y="true">Escalera</nom></pere> y de <mere don="true" id="369">Da.     <prenom>Escolástica</prenom> <nom>Ponce</nom> de <nom de="true">León</nom></mere></epoux>,<epouse don="true" id="367"> con Da.     <prenom>María </prenom><prenom>Josefa</prenom> <nom>BALBASTRO</nom>     <nom>DAVILA</nom> de <nom de="true">AGÜERO</nom>, natural de     <naissance-lieu>ésta</naissance-lieu>, hija legítima de <pere don="true" id="370">Dn. <prenom>Isidro</prenom> <nom>Balbastro</nom> </pere>y de     <mere don="true" id="371">Da. <prenom>Bernarda</prenom> <nom>Dávila</nom> de <nom de="true">Agüero</nom></mere>, vecinos de esta     Parroquia</epouse>.<temoins> <temoin ExcelentisimoSenor="true" id="372">Ts.: el     Excelentísimo Señor <condition>Teniente General de los Reales     Ejércitos</condition>, <condition>Virrey del Perú </condition>y     <condition>Virrey que ha sido del Nuevo Reino ide Granada </condition>Dn.     <prenom>Manuel</prenom> <nom>Gririor</nom> </temoin><temoin don="true" id="373">y     su esposa la <condition>Señora Virreina</condition>, Da.     <prenom>María</prenom> <nom>Ventura</nom> <nom>Gririor</nom></temoin>.     (</temoins>f. 193v.).</ACTE>')
