26-06-2013 10:38 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('4789', '<ACTE num="4789">4811) <date>13-6-1785</date>: Dn. <epoux don="true" id="374"><prenom>José </prenom><prenom>María</prenom>     <nom>CALDERON</nom> de la <nom de="true" la="true">BARCA</nom>, natural de     la ciudad de <naissance-lieu>Sevilla</naissance-lieu>, hijo legítimo de     <pere don="true" id="376">Dn. <prenom>Antonio </prenom><prenom>Francisco</prenom>     <nom>Calderón</nom> de la <nom de="true" la="true">Barca</nom></pere>, y     de <mere don="true" id="377">Da. <prenom>Isabel </prenom><prenom>Ana</prenom> de     <nom de="true">Vera</nom></mere></epoux>, con <epouse don="true" id="375">Da.     <prenom>María </prenom><prenom>Josefa</prenom> <nom>BELGRANO</nom>     <nom>PEREZ</nom>, natural de <naissance-lieu>ésta</naissance-lieu>, <pere don="true" id="378">hija legítima del Capitán de Milicias Urbanas y Alférez Real     que ha sido de ésta y Regidor y su Síndico Procurador (Dn.     <prenom>Domingo</prenom> Belgrano Pérez) [<nom>Belgrano</nom>     <nom>Peri</nom>] </pere>y de<mere don="true" id="379"> Da. <prenom>Josefa     </prenom><nom>González</nom></mere>.</epouse> Ts.: <temoins><temoin don="true" id="378">Dn. <prenom>Domingo </prenom><nom>Belgrano </nom>     <nom>Peri</nom> <condition>Capitán de Milicias Urbanas </condition>y     <condition>Alférez Real </condition>que ha sido de ésta y     <condition>Regidor </condition>y su <condition>Síndico Procurador     </condition></temoin>y <temoin don="true" id="379">Da. <prenom>Josefa     </prenom><nom>González</nom></temoin></temoins>, padres de la contrayente.     Al margen: "saqué copia a 30-6-1786". (f. 430).</ACTE>')
