26-06-2013 10:38 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('6813', '<ACTE num="6813">6849) <date>9-5-1808</date>: <epoux don="true" id="387">Dn.     <prenom>Joaquín </prenom><nom>BELGRANO</nom> <nom>GONZALEZ</nom>, natural     de <naissance-lieu>ésta</naissance-lieu>, <condition>Oficial Real     Honorario</condition>, hijo legítimo de Dn. <pere id="378">         <prenom>Domingo </prenom>          <nom>Belgrano</nom>          <nom>Peri</nom>       </pere>y de Da. <mere id="389">         <prenom>María</prenom>          <prenom>Josefa </prenom>          <nom>González</nom>       </mere></epoux>, con <epouse don="true" id="388">Da. <prenom>Catalina     </prenom><nom>MELIAN</nom>, natural de     <naissance-lieu>ésta</naissance-lieu>, hija legítima de <pere don="true" id="390">Dn. <prenom>Antonio </prenom><nom>Melián</nom> </pere>y de Da.     <mere don="true" id="391">         <prenom>María </prenom>          <prenom>Josefa</prenom>          <nom>Correa</nom>       (viuda de <veuve don="true">Dn. <prenom>Juan</prenom>     <prenom>Tomás</prenom> <nom>Martínez</nom></veuve>)</mere></epouse>. Ts.:     <temoins>el <temoin don="true" id="392"><condition>Clérigo Presbítero</condition>     Dn. <prenom>Francisco</prenom> <nom>Robles</nom></temoin> y Dn. <temoin id="393">         <prenom>Francisco </prenom>          <prenom>Belgrano</prenom>       </temoin></temoins>. (f. 558).</ACTE>')
