26-06-2013 10:38 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('7573', '<ACTE num="7573">7615) <date>9-8-1820</date>: <epoux don="true" id="394">Dn. <prenom>Miguel </prenom><nom>BELGRANO</nom>, natural de     <naissance-lieu>ésta</naissance-lieu>, hijo legítimo de <pere don="true" id="378">Dn. <prenom>Domingo </prenom><nom>Belgrano</nom>     <nom>Peri</nom></pere> y de <mere don="true" id="379">Da. <prenom>Josefa     </prenom><nom>González</nom></mere></epoux>, con <epouse don="true" id="395">Da.     <prenom>Flora </prenom><nom>RAMOS</nom>, natural de     <naissance-lieu>ésta</naissance-lieu>, hija legítima de <pere don="true" id="396">Dn. <prenom>Ignacio </prenom><nom>Ramos</nom>     <nom>Villamil</nom> </pere>y de Da. <mere don="true" id="397">         <prenom>Juana</prenom>          <nom>Belgrano</nom>       </mere></epouse>, dispensado el impedimento de parentesco de     consanguinidad en segundo grado con atingencia al primero. Ts.:<temoins>     Dn. <temoin don="true" id="398">         <prenom>José</prenom>          <prenom>María </prenom>          <nom>Calderón</nom>       </temoin>, el <temoin don="true" id="399"><condition>Doctor</condition> Dn.     <prenom>José</prenom> <nom>Redchead</nom> </temoin>y <temoin don="true" id="400">Dn. <prenom>Ignacio </prenom><nom>Alvarez</nom>,     <condition>Coronel Mayor</condition> </temoin>de las armas de la Patria,     (f. 246).</temoins></ACTE>')
