26-06-2013 10:38 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('4227', '<ACTE num="4227">4253) <date>4-11-1757</date>: <epoux don="true" id="403">Dn.     <prenom>Domingo</prenom> de <nom de="true">BELGRANO</nom>, natural de la     ciudad de <naissance-lieu>Oneglia, Italia, Estado de Génova, Reino de     Cerdeña</naissance-lieu>, hijo legítimo de <pere don="true" id="404"><prenom>Carlos</prenom> de <nom de="true">Belgrano</nom></pere>     y de <mere don="true" id="405">Da. <prenom>María</prenom>     <nom>Peri</nom></mere></epoux>, con <epouse don="true" id="389">Da.     <prenom>María</prenom> <prenom>Josefa</prenom> <nom>GONZALEZ</nom>,     natural de <naissance-lieu>ésta</naissance-lieu>, hija legítima de <pere id="406">         <prenom>Juan</prenom>          <prenom>Manuel</prenom>          <nom>González </nom>       </pere>y de <mere don="true" id="407">Da. <prenom>Inés</prenom>     <nom>Casero</nom></mere></epouse>. Ts.: <temoins><temoin don="true" id="408">Dn.     <prenom>José</prenom> <nom>Molina</nom>, <condition>Secretario de este     Gobierno</condition> y <condition>Capitanía General</condition> y     <condition>Capitán de este Real Presidio</condition> </temoin>y <temoin don="true" id="409">Da. <prenom>Gregoria</prenom> de <nom de="true">Salas</nom></temoin></temoins>. Al margen: "copiada a pedimento     de dicho Dn. Domingo Belgrano en 27-11-1765". (f. 86).</ACTE>')
