26-06-2013 10:39 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('6871', '<ACTE num="6871">6917) 2<date>5-9-1809</date>:<epoux don="true" id="433"> Dn.     <prenom>José </prenom><prenom>Agustín</prenom> de <nom de="true">LIZAUR</nom>, natural del Pueblo de <naissance-lieu>Ceraín,     Guipúzcoa</naissance-lieu>, hijo legítimo de <pere don="true" id="435">Dn.     <prenom>Miguel </prenom>de <nom de="true">Lizaur</nom> </pere>y de Da.     <mere don="true" id="436">         <prenom>Anastasia</prenom>          <nom>Oñatibi</nom>       </mere></epoux>, con <epouse don="true" id="434">Da. <prenom>María</prenom>     <prenom>Antonia</prenom> <nom>DARGAIN</nom>, natural de     <naissance-lieu>ésta</naissance-lieu>, hija legítima de Dn. <pere don="true" id="437">         <prenom>Juan </prenom>          <prenom>Bautista </prenom>          <nom>Dargain </nom>       </pere>y de Da. <mere don="true" id="438"><prenom>María </prenom><prenom>del     Rosario</prenom> <nom>Belgrano</nom> y <nom y="true">González</nom></mere>.</epouse> <temoins>Ts.: el Padre     <temoin id="439"><condition>Fray</condition> <prenom>Hilarión</prenom> de <nom de="true">Etura</nom></temoin>, <temoin id="440"><condition>Fray     </condition><prenom>Miguel</prenom> de <nom de="true">Torres</nom></temoin>, Dn. <temoin don="true" id="441">         <prenom>Tomás</prenom>          <nom>Balansetegui</nom>       </temoin>y Dn. <temoin don="true" id="374"><prenom>José     </prenom><prenom>María</prenom> <nom>Calderón</nom> de la <nom de="true" la="true">Barca</nom>.</temoin></temoins> Nota: al margen el contrayente     figura comoDn. José Agustín de Elizaur. (f. 21v.).</ACTE>')
