26-06-2013 10:39 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('7379', '<ACTE num="7379">7423) <date>18-6-1817</date>: Dn. <epoux don="true" id="442"><prenom>Antonio </prenom><prenom>Francisco</prenom> LELOAIR     (sic) [<nom>LELOIR</nom>], natural de <naissance-lieu>Santa María Doloron,     Reino de Francia</naissance-lieu>, hijo legítimo de <pere don="true" id="444">Dn.     Antonio Leloair (sic) [Leloir</pere>]y de <mere don="true" id="445">Da. Juana María     Capdapon (sic) [Capdepont</mere>]</epoux>, con<epouse don="true" id="443"> Da.     <prenom>Sebastiana</prenom> <nom>SAENZ</nom> <nom>VALIENTE</nom>, natural     de <naissance-lieu>ésta</naissance-lieu>, hija legítima de <pere difunto="true" don="true" id="446">Dn. <prenom>Anselmo </prenom><nom>Sáenz</nom>     <nom>Valiente</nom> </pere>y de <mere difunto="true" don="true" id="447">Da.     <prenom>Juana </prenom><nom>Pueyrredón</nom></mere>,     difuntos</epouse>.Ts.: <temoins><temoin don="true" id="162">Dn. <prenom>Francisco     </prenom><nom>Belgrano </nom></temoin>y Da. <temoin don="true" id="448">         <prenom>María </prenom>          <prenom>Magdalena</prenom>          <nom>Pueyrredón</nom>       </temoin>.</temoins> (f. 185).</ACTE>')
