26-06-2013 10:39 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('7383', '<ACTE num="7383">7427) <date>8-7-1817</date>: Dn. <epoux don="true" id="449"><prenom>Francisco </prenom><nom>LYNCH</nom>, <condition>Capitán     de Artillería de Marina</condition>, natural de     <naissance-lieu>ésta</naissance-lieu>, hijo legítimo de <pere don="true" id="451">Dn. <prenom>Domingo </prenom><prenom>Esteban</prenom>     <nom>Lynch</nom> </pere>y de <mere don="true" id="452">Da. <prenom>Juana     </prenom><nom>Arandia</nom></mere></epoux>, con <epouse don="true" id="450">Da.     <prenom>Rita </prenom><nom>PUEYRREDON</nom>, natural de     <naissance-lieu>ésta</naissance-lieu>, hija legítima de <pere don="true" id="453">Dn. <prenom>José </prenom><nom>Pueyrredón</nom> </pere>y de Da.     <mere don="true" id="454">         <prenom>Manuela </prenom>          <nom>Caamaño</nom>       </mere></epouse>. Ts.: el <temoins>Señor <temoin id="455"><condition>Coronel y     Secretario de Guerra </condition>Dn. <prenom>Matías</prenom> <nom>Irigoyen     </nom></temoin>y la <temoin don="true" id="448"><condition>Señora</condition> Da.     <prenom>María</prenom> <prenom>Magdalena</prenom>     <nom>Pueyrredón</nom></temoin></temoins>. (f. 186v.).</ACTE>')
