26-06-2013 10:39 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('4968', '<ACTE num="4968">4990) <date>24-10-1793</date>: <epoux don="true" id="467">Dn.     <prenom>José </prenom><prenom>María</prenom>     <naissance-lieu>FERNANDEZ</naissance-lieu> de <nom de="true">ACEVEDO</nom>, natural de la ciudad de     <naissance-lieu>Cádiz</naissance-lieu>, hijolegítimo de <pere don="true" id="469">Dn. <prenom>Miguel </prenom><nom>Fernández</nom> de <nom de="true">Acevedo</nom></pere>, y de <mere id="470">Da. <prenom>María</prenom>     <prenom>de los Dolores</prenom> <nom>Martínez</nom></mere></epoux>, con     <epouse don="true" id="468">Da. <prenom>Juana</prenom> <prenom>Francisca     </prenom><prenom>Josefa Buenaventura</prenom> <nom>BELGRANO</nom>     <nom>PEREZ</nom>, natural de <naissance-lieu>ésta</naissance-lieu>, <pere don="true" id="378">hija legítima del Capitán Dn. <prenom>Domingo</prenom> Belgrano     Pérez [<nom>Belgrano</nom> <nom>Peri</nom>], Regidor y Alférez Real que ha     sido de ésta </pere>y de Da. María Josefa González</epouse>. Ts.:     <temoins><temoin don="true" id="378">Dn. <prenom>Domingo</prenom>     <nom>Belgrano</nom> <nom>Peri</nom>, <condition>Capitán que ha sido de     ésta</condition> <condition>Regidor que ha sido de ésta</condition> y     <condition>Alférez Real que ha sido de ésta</condition> </temoin>y <temoin don="true" id="389">Da. <prenom>María</prenom> <prenom>Josefa</prenom>     <nom>González</nom></temoin>. Casados en la Iglesia de Monserrat. (f.     544).</temoins></ACTE>')
