26-06-2013 10:39 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('5598', '<ACTE num="5598">5627) <date>14-5-1776</date>: Dn.     <epoux id="477"><prenom>Julián</prenom> <nom>GREGORIO</nom> de <nom de="true">ESPINOSA</nom>, natural del lugar de <naissance-lieu>Belvís de     la Jara, Arzobispado de Toledo</naissance-lieu></epoux>, con <epouse don="true" id="478">Da. <prenom>María</prenom> <prenom>Florencia</prenom>     <nom>BELGRANO</nom> <nom>PEREZ</nom>, hija legítima de Dn. <pere don="true" id="378">         <prenom>Domingo </prenom>          <nom>Belgrano</nom>          <nom>Peri</nom>       </pere>érez y de <mere don="true" id="389">Da. <prenom>María     </prenom><prenom>Josefa</prenom> <nom>González</nom></mere>, vecinos de     ésta. </epouse>Ts.: <temoins><temoin don="true" id="425">Dn. <prenom>Diego</prenom>     de <nom de="true">Agüero</nom> </temoin>y su esposa <temoin don="true" id="479">Da.     <prenom>Petrona </prenom><nom>Gregorio</nom> de <nom de="true">Espinosa</nom></temoin></temoins>, (f. 156).</ACTE>')
