26-06-2013 10:39 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('5980', '<ACTE num="5980">6022) <date>10-7-1793</date>:<epoux don="true" id="480"> Dn.     <prenom>Antonio </prenom><nom>DURANTE</nom>, <condition>Ingeniero     Extraordinario</condition>, natural de la<naissance-lieu> Villa y Corte de     Madrid</naissance-lieu>, hijo legítimo de <pere don="true" id="482">Dn.     <prenom>Antonio </prenom><prenom>Ignacio</prenom> <nom>Durante</nom>     </pere><mere don="true" id="483">y de Da. <prenom>María</prenom>     <prenom>Angela</prenom> <nom>Rey</nom></mere></epoux>, con <epouse don="true" id="481">Da. <prenom>María</prenom> <prenom>de la Concepción</prenom>     <nom>SALAS</nom>, natural de la ciudad de     <naissance-lieu>Ceuta</naissance-lieu>, Dominios de España, hija legítima     del <pere don="true" id="484">Señor Dn. <prenom>Diego</prenom> de <nom de="true">Salas</nom>, Teniente de Rey que fue de esta Plaza </pere>y de     la <mere don="true" id="485">Señora Da. <prenom>María</prenom>     <prenom>Benita</prenom> <nom>Tiragalo</nom></mere></epouse>. Ts.: <temoins>         <temoin don="true" id="486">Dn. <prenom>Diego</prenom> <nom>Casero</nom>         </temoin>          <temoin don="true" id="487">y su esposa Da. <prenom>María</prenom> <prenom>del         Rosario</prenom> <nom>Salas</nom></temoin>       </temoins>, (f. 267v.).</ACTE>')
