26-06-2013 10:39 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('6086', '<ACTE num="6086">6128) <date>17-12-1798</date>:<epoux don="true" id="501">Dn.     <prenom>Juan</prenom> <prenom>Bautista</prenom> <nom>ITUARTE</nom>,     natural de Bilbao la Vieja, hijo legítimo de <pere don="true" id="501">Dn.     <prenom>Juan </prenom><prenom>Bautista </prenom><nom>Ituarte</nom>     </pere>y de <mere don="true" id="503">Da. <prenom>Ignacia </prenom>de <nom de="true">Aguirre</nom></mere></epoux>, con <epouse don="true" id="502">Da.     <prenom>Magdalena </prenom><nom>PUEYRREDON</nom>, natural de     <naissance-lieu>ésta</naissance-lieu>, hija legítima de <pere don="true" id="414">Dn. <prenom>Juan </prenom><prenom>Martín</prenom>     <nom>Pueyrredón</nom> </pere>y de <mere don="true" id="415">Da. <prenom>Rita     </prenom><nom>Dogan</nom></mere></epouse>. Ts.: <temoins><temoin don="true" id="446">Dn. <prenom>Anselmo </prenom><nom>Sáenz     </nom><nom>Valiente</nom> </temoin>y <temoin don="true" id="415">Da. <prenom>Rita     </prenom><nom>Dogan</nom></temoin>. Nota: esta partida está repetida en el     folio 305, con fecha 18-1-1799 y con los testigos <temoin don="true" id="416">Dn.     <prenom>Andrés </prenom><nom>Rincón</nom> </temoin>y <temoin don="true" id="417">Da.<prenom>Isabel </prenom><nom>Dogan</nom></temoin></temoins>.     (f. 301 v.).</ACTE>')
