26-06-2013 10:39 Axelle INSERT INTO actes_contenu (id_acte, contenu) VALUES ('7114', '<ACTE num="7114">7159)<date>27-4-1812</date>: Dn. <epoux don="true" id="520"><prenom>Francisco</prenom> de <nom de="true">CHAS</nom>,     natural de la ciudad de <naissance-lieu>Betanzos,     Galicia</naissance-lieu>, hijo legítimo de <pere don="true" id="521">Dn.     <prenom>Juan </prenom>de <nom de="true">Chas </nom></pere>y de <mere don="true" id="522">Da. <prenom>María </prenom><prenom>Antonia</prenom>     <nom>Pombo</nom></mere></epoux>, con<epouse don="true" id="397"> Da.     <prenom>Juana</prenom> <nom>BELGRANO</nom>, viuda de <veuve id="396">Dn.     <prenom>Ignacio </prenom><nom>Ramos</nom> <nom>Villamil</nom></veuve>,     natural de <naissance-lieu>ésta</naissance-lieu>, hija legítima de     <pere id="403">Dn. <prenom>Domingo </prenom><nom>Belgrano</nom> </pere>y de     Da.<mere id="389">         <prenom>María</prenom>          <prenom>Josefa</prenom>          <nom>González</nom>       </mere>.</epouse> Ts.: <temoins><temoin don="true" id="523">Dn.     <prenom>Fruto</prenom> <nom>Herrera </nom></temoin>y <temoin don="true" id="524">Da. <prenom>Nicolasa</prenom> <nom>Arias</nom></temoin>,     </temoins>(f. 104v.).</ACTE>')
